import React from "react";

const Header = () => {
    return (
        <header className="flex p-5">
            <img src="/assets/Logo@3x.png" alt="logo" />
        </header>
    );
}

const Footer = () => {
    return (
        <footer className="bg-slate-900 text-center p-3">
            <p className="text-white">All rights reserved. Shawormaa</p>
        </footer>
    );
}

const Layout = ({ children }) => {
    return (
        <>
            <Header /> 
            <main>
                {children}
            </main>
            <Footer />
        </>
    );
}

export default Layout;
